import React, { Component } from 'react';
import styled from 'styled-components';
import { Twitter } from 'react-feather';

const StyledNav = styled.nav`
  display: flex;
  flex-flow: column nowrap;
`;

export default class Nav extends Component {
  render() {
    return (
      <StyledNav>
        <Twitter />
        <div>something</div>
      </StyledNav>
    )
  }
}
